if (request_expression) {
    let thisValue = request_expression.reduce((acc, obj) => {
        if (obj.operator === '=' && obj.value) {
            acc = obj.value;
        }
        return acc;
    }, '');

    done({
        "request_vendor_parameters": {
            'query': thisValue
        }
    });
}

done();

var data_center = response_body.dc;
var url = ".api.mailchimp.com";
configuration['subdomain'] = data_center+url;

done({
	"configuration":configuration
});

var key = "OAuth "+ configuration['oauth.user.token'];
request_vendor_headers["Authorization"] = key; 

done({  
 "request_vendor_headers": request_vendor_headers  
});

var formattedEvents = []; 
var eventObj = {}; 

//for localhost key is coming as 'data[list_id]' hence to set id properly in localhost added below check 
if(events.hasOwnProperty('data[list_id]')){ 
 eventObj.event_object_id=events['data[list_id]']; 

}else{  
var bodyData = events['data']; 
 eventObj.event_object_id = bodyData['list_id']; 

} 
var webhook_types = events.type; 
var webhook_header = events.eventHeaders['user-agent']; 
if(webhook_header === 'MailChimp.com WebHook Validator') { 
 done(); 
} 

if(webhook_types === 'unsubscribe') { 
 eventObj.event_type = 'UPDATED'; 
 eventObj.event_object_type = 'list';} 
else if(webhook_types === 'subscribe') { 
 eventObj.event_type = 'CREATED'; 
 eventObj.event_object_type = 'list';} 
else if(webhook_types === 'profile') { 
 eventObj.event_type = 'UPDATED'; 
 eventObj.event_object_type = 'list';} 
else if(webhook_types === 'cleaned') { 
 eventObj.event_type = 'UPDATED'; 
 eventObj.event_object_type = 'list';} 
else if(webhook_types === 'upemail') { 
 eventObj.event_type = 'UPDATED'; 
 eventObj.event_object_type = 'list';} 
else if(webhook_types === 'campaign') { 
 eventObj.event_type = 'UPDATED'; 
 eventObj.event_object_type = 'list';} 

formattedEvents.push(eventObj); 
done({ 
 "events" : formattedEvents 
})
